THE ALEX JONES SHOW
2009.04.17 Friday

Alex talks with Steve Shank on food production and basic freedoms to exist in the first hour. Alex also welcomes talkshow host Rollye James and regular guest Bob Chapman of the International Forecaster.

HR 1: Show info, socio commentary (US torture, etc.), musical interlude, Steve Shank
HR 2: Steve Shank, open lines, BOB CHAPMAN with calls
HR 3: Bob Chapman, Ted Anderson, open lines, clip from Martial Law 911
HR 4: caller on Codex Alimentarius, ROLLYE JAMES


